webpackJsonp([49869633817047],{4176:function(t,e){t.exports={data:{markdownRemark:{html:'<p><code>// IMAGE/foo/bar/hoge.pngの場合 let IMAGE_FOO_BAR_HOGE = GetCurrentScriptDirectory() ~ "IMAGE\\foo\\bar\\hoge.png";</code></p>\n<ul>\n<li>ファイル名は基本的には“index.dnh”とする。</li>\n<li>例外：敵インデックスのみ埋もれ防止のため“<strong>index.dnh”のように“</strong>”を頭につけること。</li>\n<li>画像ファイルパス変数は定数扱いとし、表記は大文字とアンダースコアのみを推奨する。</li>\n<li>インデックスが多い場合は、関数呼び出しのオーバーヘッド防止のため<code>GetCurrentScriptDirectory()</code>の戻り値を事前に変数に入れておき、そこから使うこと。</li>\n</ul>',frontmatter:{cover:null,date:"2008-04-26T00:00:05+09:00",strDate:"2008/4/25",title:"インデックス"}}},pathContext:{path:"/ja/blog/2008/04/26-インデックス/",langKey:"ja"}}}});
